{
    int ode1 = 0 * numSys + i;
    int ode2 = 1 * numSys + i;
    int ode3 = 2 * numSys + i;
    int ode4 = 3 * numSys + i;

    int ind1 = 0 * numSys + i;
    int ind2 = 1 * numSys + i;
    int ind3 = 2 * numSys + i;
